import React, { Component } from ' react';
import Videodata from './page1';
import Imagedata from './page2';
import './style.css'

class Body extends Component {
    render() {
        var displaycontent = ()=>{
            var activetab = this.props.activetab;
            if(activetabtab == 1) {
                return <Videodata/>
            } else if (activetab == 2) {
                return <Imagedata/>
            } else if (activetab == 3) {
                return <div className = "text">page 3</div>
            } else if (activetab == 4) {
                return <div className = "text">page 4</div>
            } else {
                return <div className = "text">page 5</div>
            }
        }

        return(displaycontent())
    }
}

export default Body;
